import { Component, OnInit } from '@angular/core';
import { Militar } from '../militar';
import { MilitarService } from '../militar.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-create-militar',
  templateUrl: './create-militar.component.html',
  styleUrls: ['./create-militar.component.css']
})
export class CreateMilitarComponent implements OnInit {

 militar: Militar = new Militar();

  constructor (private militarService: MilitarService,
    private router: Router) { }


  ngOnInit(): void { }

    saveMilitar() {
      this.militarService.createMilitar(this.militar).subscribe(data =>{
        console.log(data);
        this.goToMilitarList();
      },
      error => console.log(error));
    }

    goToMilitarList() {
      this.router.navigate(['/militars']);
    }

    onSubmit(){
      console.log(this.militar);
      this.saveMilitar();
    }
}
